package com.class109_NestedLoops;

public class NestedLoopExercise {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//NUMBERS (9999)
		
				for (int x = 0;x<10;x++) {
					for (int y = 0;y<10;y++) {
						for (int z = 0;z<10;z++) {
							for (int t = 0;t<10;t++) {
								System.out.println(x+""+y+""+z+""+t);
							}
						}
					}
				}
	}

}
